import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHeart,
  faComment,
  faShareSquare,
} from "@fortawesome/free-solid-svg-icons";

export class MainSection extends Component {
  render() {
    return (
      <div className="container content">
        <div class="card card-div" style={{ width: 180 }}>
          <h5 className="card-title">Card Title Top </h5>
          <img
            class="card-img-top"
            src="/images/Priyanka.jpeg"
            alt="Card image cap"
          />
          <div class="card-body">
            <h5 className="card-title">
              <FontAwesomeIcon className="mr-1" icon={faHeart} />
              <FontAwesomeIcon className="mr-2" icon={faComment} />
              <FontAwesomeIcon icon={faShareSquare} />
            </h5>
            <p class="card-text">221000 likes</p>
            <p class="card-text">
              {" "}
              Happy birthday queen❤️ you're one of my most favorite actresses
              and I adore you so much. One time you noticed me and called me
              amazing, that was the happiest day of my life.❤️
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default MainSection;
